import React from 'react';
import { BarChart, LineChart } from './Charts';

function Dashboard() {
  return (
    <div>
      <h2>Dashboard</h2>
      <div style={{ marginBottom: 30 }}>
        <BarChart />
      </div>
      <div>
        <LineChart />
      </div>
    </div>
  );
}

export default Dashboard;
